import React from 'react';
import NewsListedBig from './NewsListedBig';
import SecondaryButton from '../buttons/SecondaryButton'
import data from './news-data'

export default function NewsListBig(props){
    var arr = JSON.parse(data);
    var elements = []
    for(var i = 0; i < props.toRender; i++){
        elements.push(
            <NewsListedBig
                title={arr[i].title}
                text={arr[i].text}
                src={arr[i].src}
                />
            )
    }
    return(
        <div className="news-list-big-container">
            {elements}
            <div className="news-list-big-button-container">
                <SecondaryButton
                    text="Wczytaj wiÄ™cej"
                    />
            </div>
        </div>
    )
}
